import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const WishListScreen = () => {
  return (
    <View>
      <Text>WishListScreen</Text>
    </View>
  )
}

export default WishListScreen

const styles = StyleSheet.create({})
